import React from "react";
import "./Component12.css";

function Component12(props) {
  const { vector, vector2 } = props;

  return (
    <div className="component-12">
      <div className="layer-235">
        <div className="checkmark-circle-22">
          <img className="vector-314" src={vector} />
          <img className="vector-411" src={vector2} />
        </div>
      </div>
    </div>
  );
}

export default Component12;
